import React, { useEffect, useState } from 'react';
import axios from 'axios';

const BuoyData = () => {

  const fetch = require('node-fetch');  // If you're running this in Node.js
  const [swellHeight, setSwellHeight] = useState(null);
  const [data, setData] = useState(null);
  const buoyId = '46224';  // Buoy ID for Oceanside, California

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await axios.get('http://localhost:3002/proxy');
        setData(response.data);
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };

    fetchData();
  }, []);

  useEffect(() => {
    const firstRecord = JSON.stringify(data).split('2023')[1];
    const waveHeight = JSON.stringify(firstRecord).split(' ')[0];
    console.log(`DATA: ${waveHeight}`)
  }, [data]);

  return (
    <div>
      {data ? (
        <div>
          <h1>Data from API:</h1>
          <pre>{JSON.stringify(data, null, 2)}</pre>
        </div>
      ) : (
        <div>Loading data...</div>
      )}
    </div>
  );


};

export default BuoyData;
